import React from "react";
import "./Connect.css";
// import logo from "../../images/certifications.png";

const Connect = () => {
  return (
    <>
      <div className="connectContainer" style={{fontFamily:"Playfair Display SC"}}>
        <p>I've networks through</p><br /><br /><br />
        <div className="icons">
          <i className="fa-solid fa-phone"></i>
          <i class="fa-solid fa-envelope"></i>
          <i class="fa-brands fa-linkedin"></i>
          <i className="fa-brands fa-github"></i>
        </div>
      </div>
    </>
  );
};

export default Connect;
